import React from 'react'

export default function Square(props) {
    return (
      <button
        className={"square " + (props.isWinning ? "square--winning" : null)}
        onClick={props.onClick}
       disabled={true}>
        {props.value}
      </button>

        // <button className="square" onClick={props.onClick}>
        //     {props.value}
        // </button>
    )
}
